  const [cardInfo, setCardInfo]=useState(CardData);
  //console.log(cardInfo);
  return (
    <>
     <nav className='navbar'>
        <div className='btn-group'>
          <button className='btn-group_item' href='#home'>All</button>
          <button className='btn-group_item'>Series</button>
          <button className='btn-group_item'>Movies</button>
          <button className='btn-group_item'>Documentries</button>
        </div>
      </nav>

      <div className="heading_style">List of Top Netflix Shows by Categories: Yuva React App</div>
     
      <Card cardInfo={cardInfo}/>
      
    </>
  )}

export default MyApp;
